import React , { Component } from 'react';

const About = () => {

    return(
        <p>Renouick is a way to connect customers who are not capable of finding services and workers who are not capable of promoting their services.
        In the current society people face problems in finding workers for their day to day problems. 
        Even if many workers are available if they cannot be founded when needed there is no use. 
        That is why we provided a solution by introducing Renoick</p>
    );
};

export default About;
